import React from 'react';

const CompForm1 = () => {
  return (
    <form>
      <fieldset>
        <legend>자바스크립트 문법 활용하기</legend>
        <p>
          <input value="라디오1" type="radio" name='radio1'/>라디오1
          <input value="라디오2" type="radio" name='radio1'/>라디오2
        </p>
        <p>
          <input type="text" />
        </p>
        <button>초기화하기</button>
      </fieldset>
    </form>
  );
};

export default CompForm1;
